webpackJsonp([0xb0fcc8901ab7],{1778:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2009-01-18-a-very-sexy-madone/index.md absPath of file >>> MarkdownRemark",html:'<p>Lance \'s return to cycling is something that I am sure many people are watching with anticipation and curiosity. He is one of the greatest if not the greatest cyclist of all time. Personally, I like to see the equipment Trek is setting him up with. Here\'s a few links to pictures of his new Madone in LIVESTRONG colors:</p>\n<p><a href="http://trekroad.typepad.com/trekroad/2009/01/delivery-the-bike.html">http://trekroad.typepad.com/trekroad/2009/01/delivery-the-bike.html</a></p>\n<p><a href="http://www.theroaddiaries.com/?p=258">http://www.theroaddiaries.com/?p=258</a></p>\n<p>It took 30 hours to paint the bike and it shows.</p>\n<p>I have to also say that after watching cancer have such a terrible impact on so many people I also admire Lance\'s efforts to promote cancer awareness.</p>\n<p>Here are the numbers painted on the bike:\n1274 - The number of days Lance was "retired".\n27.5 - million people is the approximate number of people that died from cancer during that same time.</p>',frontmatter:{title:"A Very Sexy Madone",date:"January 18, 2009",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{}}}});
